        e.preventDefault();
        const url =`http://192.168.1.18:8000/api/method/sagasuite.customer_api.fetch_value?email_id=thamizharasan2510@gmail.com`
        try{
            const result = await axios.get(url);
            console.log(result.dst)
        }
        catch(error){console.log(error)}
    }
    return(
        <div className="v-card">
            <h1>Email verification</h1>
